function getParameterByName(name, url) {
	if (!url) url = window.location.href;
	name = name.replace(/[\[\]]/g, "\\$&");
	var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
		results = regex.exec(url);
	if (!results) return null;
	if (!results[2]) return '';
	return decodeURIComponent(results[2].replace(/\+/g, " "));
}

var visual = $(".visual");
visual.bootstrapToggle({
	on: '<span class="glyphicon glyphicon-eye-close"></span>',
	off: '<span class="glyphicon glyphicon-eye-open"></span>'
});
visual.each(function(){
	$(this).on({
		change: function(e){
			var on = $(this).prop('checked');
			var graph = echarts.getInstanceByDom(document.getElementById($(this).attr("data")));
			if(on){
				graph.setOption({
					visualMap: [{
								type: 'continuous',
								min: 0,
								max: 50,
								dimension: 1,
								text:['Outdegree',''],
								realtime: false,
								calculable : true
							}
				   ,{
							type: 'continuous',
							min: 0,
							max: 1000,
							bottom: 200,
							dimension: 0,
							text:['Indegree',''],
							realtime: false,
							calculable : true,
							color: ['orangered','yellow','lightskyblue']
						}
					]
				})
			}else{
				graph.setOption(op, true);
			}
		}
	});
})


var legend = $(".legend");
legend.bootstrapToggle({
	on: '<span class="glyphicon glyphicon-th"></span>',
	off: '<span class="glyphicon glyphicon-th"></span>'
});
legend.each(function(){
	$(this).on({
		change: function(e){
			var on = $(this).prop('checked');
			var graph = echarts.getInstanceByDom(document.getElementById($(this).attr("data")));
			if(on){
				graph.setOption({
					legend:{
						show: true
					}
				})
			}else{
				graph.setOption({
					legend:{
						show: false
					}
				})
			}
		}
	});
})

var flscn = $(".flscn");
flscn.bootstrapToggle({
	on: '<span class="glyphicon glyphicon-resize-small"></span>',
	off: '<span class="glyphicon glyphicon-resize-full"></span>'
});
flscn.each(function(){
	$(this).on({
		change: function(e){
			var full = $(this).prop('checked');
			var p = document.getElementById($(this).attr("data"));
			if(full){
				if(p.webkitRequestFullScreen){
					p.webkitRequestFullScreen();
				}else{
					p.mozRequestFullScreen();
				}
			}else{
				if(document.webkitCancelFullScreen){
					document.webkitCancelFullScreen();
				}else{
					document.mozCancelFullScreen();
				}
			}
		}
	});
});

var getXY = function(x, y){
	var temX = x;
	var temY = y;

	if(x < 20){
		x = 50 * x;
	}

	if(y < 20){
		y = 50 * y;
	}

	if(y > h){
		y = h - 50;
	}

	if(x > y){
		y = h - y;
		x = w - x;
	}

	if(x < y){

	}

	if(temX > (w / 2) || temY > (h / 2)){
		x = (Math.log(temX) + w) / 2;
		y = (Math.log(temY) + h) / 2;
	}

	x = (Math.random() * 5) * x;
	y = (Math.random() * 5) * y;
	// x = Math.exp(Math.log(124 * x));
	// y = Math.exp(Math.log(321 * y));

	return [x, y];
}

