pctn_graph.on('mouseover', function (params) {
	if(params.dataType == "edge"){
		pctn_graph.dispatchAction({
		    type: 'highlight',
		    batch: [{
	            name: params.data.source
		    }, {
	            name: params.data.target
	        }]
		});
	}
});

pctn_graph.on('mouseout', function (params) {
	if(params.dataType == "edge"){
		pctn_graph.dispatchAction({
		    type: 'downplay',
		    batch: [{
	            name: params.data.source
		    }, {
	            name: params.data.target
	        }]
		});
	}
});

